// frontend/src/components/Home/Home.js
import React from 'react';
import { 
  Container, 
  Typography, 
  Box, 
  Button, 
  Grid, 
  Card, 
  CardContent,
  useTheme 
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import AccessTimeIcon from '@mui/icons-material/AccessTime';
import AutoGraphIcon from '@mui/icons-material/AutoGraph';
import CalendarMonthIcon from '@mui/icons-material/CalendarMonth';

function Home() {
  const theme = useTheme();
  const navigate = useNavigate();

  const features = [
    {
      icon: <AccessTimeIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Smart Scheduling",
      description: "AI-powered scheduling that adapts to your study habits and preferences."
    },
    {
      icon: <AutoGraphIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Optimize Performance",
      description: "Track your progress and get insights to improve your study efficiency."
    },
    {
      icon: <CalendarMonthIcon sx={{ fontSize: 40, color: theme.palette.primary.main }} />,
      title: "Easy Planning",
      description: "Seamlessly manage your classes, assignments, and study sessions."
    }
  ];

  return (
    <Box sx={{ bgcolor: 'background.default', minHeight: '100vh' }}>
      {/* Hero Section */}
      <Box
        sx={{
          bgcolor: 'secondary.main',
          color: 'white',
          py: 8,
          mb: 6,
          borderBottom: '1px solid rgba(220, 20, 60, 0.2)',
          position: 'relative',
          '&::after': {
            content: '""',
            position: 'absolute',
            bottom: 0,
            left: 0,
            right: 0,
            height: '1px',
            background: 'linear-gradient(90deg, rgba(220,20,60,0) 0%, rgba(220,20,60,0.5) 50%, rgba(220,20,60,0) 100%)'
          }
        }}
      >
        <Container maxWidth="md">
          <Box sx={{ textAlign: 'center' }}>
            <Typography
              variant="h2"
              component="h1"
              sx={{
                mb: 2,
                fontWeight: 'bold',
                fontSize: { xs: '2.5rem', md: '3.75rem' },
                background: 'linear-gradient(45deg, #FFFFFF 30%, #DC143C 90%)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent'
              }}
            >
              Welcome to Tempo
            </Typography>
            <Typography
              variant="h5"
              sx={{
                mb: 4,
                opacity: 0.9,
                fontSize: { xs: '1.2rem', md: '1.5rem' },
                color: 'text.secondary'
              }}
            >
              Your AI-Powered Study Schedule Optimizer
            </Typography>
            <Box sx={{ 
              display: 'flex', 
              justifyContent: 'center', 
              gap: 2,
              flexWrap: 'wrap' 
            }}>
              <Button
                variant="contained"
                color="primary"
                size="large"
                onClick={() => navigate('/register')}
                sx={{
                  px: 4,
                  py: 1.5,
                  fontSize: '1.1rem',
                  background: 'linear-gradient(45deg, #DC143C 30%, #FF4D6A 90%)',
                  '&:hover': {
                    background: 'linear-gradient(45deg, #B30F32 30%, #DC143C 90%)',
                    boxShadow: '0 0 20px rgba(220, 20, 60, 0.5)'
                  }
                }}
              >
                Get Started
              </Button>
              <Button
                variant="outlined"
                color="inherit"
                size="large"
                onClick={() => navigate('/login')}
                sx={{
                  px: 4,
                  py: 1.5,
                  fontSize: '1.1rem',
                  borderColor: 'rgba(220, 20, 60, 0.5)',
                  color: 'white',
                  '&:hover': {
                    borderColor: '#DC143C',
                    boxShadow: '0 0 10px rgba(220, 20, 60, 0.3)'
                  }
                }}
              >
                Login
              </Button>
            </Box>
          </Box>
        </Container>
      </Box>

      {/* Features Section */}
      <Container maxWidth="lg" sx={{ mb: 8 }}>
        <Typography
          variant="h3"
          component="h2"
          align="center"
          sx={{
            mb: 6,
            fontSize: { xs: '2rem', md: '2.5rem' },
            color: 'text.primary'
          }}
        >
          Why Choose Tempo?
        </Typography>
        <Grid container spacing={4}>
          {features.map((feature, index) => (
            <Grid item xs={12} md={4} key={index}>
              <Card
                sx={{
                  height: '100%',
                  display: 'flex',
                  flexDirection: 'column',
                  textAlign: 'center',
                  transition: 'all 0.3s ease',
                  backgroundColor: 'background.paper',
                  border: '1px solid rgba(220, 20, 60, 0.1)',
                  '&:hover': {
                    transform: 'translateY(-5px)',
                    boxShadow: '0 0 20px rgba(220, 20, 60, 0.3)',
                    border: '1px solid rgba(220, 20, 60, 0.3)'
                  }
                }}
              >
                <CardContent>
                  <Box sx={{ 
                    mb: 2,
                    transition: 'transform 0.3s ease',
                    '&:hover': {
                      transform: 'scale(1.1)'
                    }
                  }}>
                    {feature.icon}
                  </Box>
                  <Typography
                    gutterBottom
                    variant="h5"
                    component="h3"
                    sx={{ 
                      mb: 2,
                      color: 'text.primary'
                    }}
                  >
                    {feature.title}
                  </Typography>
                  <Typography
                    variant="body1"
                    color="text.secondary"
                  >
                    {feature.description}
                  </Typography>
                </CardContent>
              </Card>
            </Grid>
          ))}
        </Grid>
      </Container>

      {/* Call to Action Section */}
      <Box
        sx={{
          bgcolor: 'secondary.main',
          py: 8,
          borderTop: '1px solid rgba(220, 20, 60, 0.2)',
          position: 'relative',
          '&::before': {
            content: '""',
            position: 'absolute',
            top: 0,
            left: 0,
            right: 0,
            height: '1px',
            background: 'linear-gradient(90deg, rgba(220,20,60,0) 0%, rgba(220,20,60,0.5) 50%, rgba(220,20,60,0) 100%)'
          }
        }}
      >
        <Container maxWidth="md">
          <Box sx={{ textAlign: 'center' }}>
            <Typography
              variant="h4"
              component="h2"
              sx={{
                mb: 3,
                fontSize: { xs: '1.75rem', md: '2.25rem' },
                color: 'text.primary'
              }}
            >
              Ready to optimize your study schedule?
            </Typography>
            <Typography
              variant="h6"
              sx={{
                mb: 4,
                fontSize: { xs: '1rem', md: '1.25rem' },
                color: 'text.secondary'
              }}
            >
              Join Tempo today and transform the way you study.
            </Typography>
            <Button
              variant="contained"
              color="primary"
              size="large"
              onClick={() => navigate('/register')}
              sx={{
                px: 4,
                py: 1.5,
                fontSize: '1.1rem',
                background: 'linear-gradient(45deg, #DC143C 30%, #FF4D6A 90%)',
                '&:hover': {
                  background: 'linear-gradient(45deg, #B30F32 30%, #DC143C 90%)',
                  boxShadow: '0 0 20px rgba(220, 20, 60, 0.5)'
                }
              }}
            >
              Get Started Now
            </Button>
          </Box>
        </Container>
      </Box>
    </Box>
  );
}

export default Home;
